// main.js
import { createApp } from 'vue';
import App from './App.vue';
import LoginForm from "./components/logiForm.vue";  
import Dashboard from "./components/attendenceForm.vue"; 
import Navigation from "./components/theNavigation.vue"  
import Leave from "./components/leaveForm.vue";
import leaveTask from "./components/leaveTask.vue";
import hrmsAttendence from "./components/hrmsAttendenceLevel.vue";
import HrmsLoginLeve from "./components/HrmsLoginLevel.vue"
import HrmsLeaveLevel from "./components/HrmsLoginLevel.vue"
import store from "./store/store"
import { createRouter, createWebHistory } from 'vue-router';

const routes = [
  {
    path: '/',
    component: LoginForm,
    name: 'login',
  },
  {
    path: '/attendence',
    component: Dashboard,
    name: 'attendence',
    props: true,
  },
  {
    path: '/navigation',
    component: Navigation,
    name: 'navigation',
  },
  {
    path: "/leave",
    component: Leave,
  },
{
  path: "/leaveTask",
  component: leaveTask,
},
{
  path: "/hrmsAttendence",
  component: hrmsAttendence,
},
{
  path: "/HrmsLoginLeve",
  component: HrmsLoginLeve,
},
{
  path: "/HrmsLeaveLevel",
  component: HrmsLeaveLevel,
},

];

const router = createRouter({
  history: createWebHistory(),
  linkActiveClass: 'active-link',
  routes,
});

const app = createApp(App);
app.use(router);
app.use(store);
app.component('LoginForm', LoginForm);
app.component('DashboardForm', Dashboard);
app.mount('#app');
